  getContractByID(caseUUID:string):Observable<any>{

    return this.http.get(`${this.apiUrl}/api/get-contract`,{
      params:{
        uuid:caseUUID
      }
    }).pipe(
      map((response) => {
        return response;
      }),
      catchError((error) => {
        this._alert.error(
          '',
          `Unexpected error occurred. Please try again later`
        ).then(()=>{

        })
        console.log('error in RegistrationService', error);
        return throwError(() => new Error(error));
      })
    );

  }

